import React from "react";
import moment from "moment";
import "./NameListItem.css";

function NameListItem(props) {
  return (
    <React.Fragment>
      <li className="list-group-item">
        <div className="row">
          
          <div className="column-sm">
            <img src={props.avatar} alt={props.avatar} />
          </div>
          <div className="column-sm">
            <p>
               {props.name}</p>
              <p>{props.city}</p>
              <p>{props.email}</p>
              <p>{moment(props.birthday).format("DD-MM-YYYY")}</p>
            
          </div>
        </div>
      </li>
    </React.Fragment>
  );
}

export default NameListItem;
